I have just, for now, a rest and a repository pattern, but in the service layer i have another autowire whit mongotemplate class, this template is used by just 1 method.</p>
<pre><code>public DetailedOrder findTheBiggestBy(String byWhat){
        Query query = new Query();
        query.with(Sort.by(Sort.Direction.DESC,byWhat)).limit(1);
        return mongoDb.findOne(query,DetailedOrder.class);
