I need to return list of data between two dates.</p>
<p>Somehow it is working only if I hardcode date in $gte and $lt</p>
<p>My api code:</p>
<pre><code>    router.get(&quot;/searchDate&quot;, async (req, res) =&gt; {
  try {
    const { startDate, endDate } = req.query;

    const containers = await Container.aggregate([
      {
        $match: {
          $or: [
            {
              manufacturingDate: {
                $gte: new Date(startDate),
                $lt: new Date(endDate),
