MongoDB - Use $addToSet with conditions<p>In a group aggregation, I'm simply trying to add names to a set if the age is 20:</p>
<p>Let's say I have the following two documents:</p>
<pre><code>_id: ...
timestamp: ...
name: Max
age: 20


_id: ...
timestamp: ...
name: Brian
age: 21
</code></pre>
<p>Now I'm trying to group these and in the <code>$group</code> and I'm trying to add the name of all 20 year-olds to a set:</p>
<pre><code>{
  $group: {
    _id: {
      bins: {
        $dateTrunc: {
          date: '$timestamp',
          unit: 'week',
          binSize: 1
        }
      }
    },
    'NamesWithAge20': {
      $addToSet: '$name'
    }
  }
}
</code></pre>
<p>I'm only interested in the 'NamesWithAge20' set. In this code right now both Max and Brian are added to the set, but I want to introduce a condition that only adds the name if the age is 20. Is that possible in this stage?</p>

